import "./login.scss"

export default function Login() {
    return(
        <div className="background-img">
            <div className="login">
                <img src="/assets/posters/bingeboxlogo.svg" className="logo" />
                <h2>Login</h2>
                <input className='signup' name='name' type="text" placeholder='Name' />
            </div>

        </div>
    )
}
